function Person(Product, Qty, Price, Tax,Discount, Total) {
  this.Product = Product;
  this.Qty = Qty;
  this.Price = Price;
  this.Tax = Tax;
  this.Discount = Discount;
  this.Total = Total;
}

function daysEntered(passDate) {
  var dayEntered = new Date(passDate).getTime();
  var now = Date.now();
  var elapsedTime = now - dayEntered;
  var day = Math.floor(elapsedTime / 8.64e+7);
  return day
}

function convertNumbersToStrings(theString) {
  var theStringParsed;
  if (theString == undefined){
     theStringParsed = "" 
    console.log("undefined price", theString);
  } else{
    theString = `${theString}`
    var frontLenght = theString.length - 3;
    var front = theString.slice(0,frontLenght);
    var back = theString.slice(frontLenght);
     theStringParsed = `${front},${back}`
  }
  return theStringParsed; 
}

function stringConstructor(theLocation){
  var fixedLocation;

  if (theLocation === undefined){
    fixedLocation = ""; 
  } else {
    var fixedLocation = theLocation;
  }
  return fixedLocation;

}


for (var i = 0; i < options.length; i += 1) {
  var newObj = new Person(options[i].Product, options[i].Qty, options[i].Price,options[i].Tax,options[i].Discount,  options[i].Total,

)
  pdfData.push(newObj);
}

function buildTableBody(data) {
  var body = [];
  var columns = ['Product', 'Qty', 'Price', 'Tax','Discount','Total'];
  body.push(columns);
  data.forEach(function (row) {
    var dataRow = [];
    columns.forEach(function (column) {
      dataRow.push(row[column].toString());
    //   console.log(dataRow);
    })
    body.push(dataRow);
  });
  return body;
}




